import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first video container and volume slider
    await page.waitForSelector('div[data-video-id="1"]');
    await page.waitForSelector('div[data-video-id="1"] input.volume-slider');

    // Set volume to 50% (0.5)
    const volumeSlider = page.locator('div[data-video-id="1"] input.volume-slider');
    await volumeSlider.evaluate((el, value) => {
        el.value = value;
        el.dispatchEvent(new Event('input', { bubbles: true }));
        el.dispatchEvent(new Event('change', { bubbles: true }));
    }, 0.5);

    // Verify the volume was set correctly
    const currentVolume = await volumeSlider.evaluate(el => el.value);

    // Take screenshot after volume adjustment
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_volume_set.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_volume_set.png'));

    return {
      success: true,
      action: "Set first video's volume slider to 50% (0.5)",
      extractedData: {
        videoId: 1,
        volumeSetTo: currentVolume,
        success: currentVolume === "0.5"
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

