import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and locate the first video container
    const videoContainer = await page.waitForSelector('div[data-video-id="1"]');

    // Hover over the video container to reveal controls
    await videoContainer.hover();

    // Wait for volume slider to be visible and interactable
    const volumeSlider = await page.waitForSelector('div[data-video-id="1"] input.volume-slider', {
      state: 'visible',
      timeout: 5000
    });

    // Set volume to 50% by modifying the input value directly
    await page.evaluate((slider) => {
      slider.value = 0.5;
      slider.dispatchEvent(new Event('input', { bubbles: true }));
      slider.dispatchEvent(new Event('change', { bubbles: true }));
    }, volumeSlider);

    // Take screenshot after setting volume
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_volume_set.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_volume_set.png'));

    // Verify the volume was set correctly
    const currentVolume = await page.$eval(
      'div[data-video-id="1"] input.volume-slider',
      (el) => parseFloat(el.value)
    );

    return {
      success: true,
      action: "Set first video's volume slider to 50%",
      extractedData: {
        finalVolume: currentVolume,
        success: Math.abs(currentVolume - 0.5) < 0.01
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
